import React, { Component } from 'react'
import ReadData from './ReadData'
import NavBar from './NavBar'
import {BrowserRouter } from 'react-router-dom'

export default class Home extends Component {
    render() {
        return (
            <BrowserRouter>
            <div>
                <NavBar/>
                <ReadData/>
            </div>
            </BrowserRouter>

        )
    }
}
